import React from "react";
import { Select } from "antd";

const handleChange = (value: string) => {
  console.log(`selected ${value}`);
};

const SelectRick: React.FC = () => (
  <Select
    defaultValue="Species"
    style={{ width: 200 }}
    onChange={handleChange}
    options={[
      {
        label: "Species",
        options: [
          { label: "alive", value: "alive", key: "species-alive" },
          { label: "dead", value: "dead", key: "species-dead" },
          { label: "unknown", value: "unknown", key: "species-unknown" },
        ],
        key: "species-options",
      },
      {
        label: "Gender",
        options: [
          { label: "male", value: "male", key: "gender-male" },
          { label: "female", value: "female", key: "gender-female" },
          {
            label: "genderless",
            value: "genderless",
            key: "gender-genderless",
          },
          { label: "unknown", value: "unknown", key: "gender-unknown" },
        ],
        key: "gender-options",
      },
    ]}
  />
);

export default SelectRick;
